import React from 'react';
import './App.css';

import {Navbar} from './components/Navbar'

export const App = () => {
  return (
    <div>

      <Navbar />
      <div>
        <h2>Nuestros establecimientos</h2>
        <hr style={{backgroundColor: '#F5B041'}} />
      </div>

    </div>
  )
}

export default App;
